// App.js
import React, { useState } from 'react';
import { Provider } from 'react-redux';
import { store } from './redux/store';
import AppRouter from './router/AppRouter'; // Роутер без BrowserRouter
import './App.css'; // Добавьте стили, если нужно
import newLogo from './assets/logo.png';

const App = () => {
  const [notes, setNotes] = useState([]);
  const [title, setTitle] = useState('');
  const [tags, setTags] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');

  const handleAddNote = (e) => {
    e.preventDefault();
    const newNote = {
      id: Date.now(),
      title,
      tags: tags.split(',').map(tag => tag.trim()),
      startDate,
      endDate,
    };
    setNotes((prevNotes) => [...prevNotes, newNote]);
    setTitle('');
    setTags('');
    setStartDate('');
    setEndDate('');
  };

  const handleDeleteNote = (id) => {
    setNotes((prevNotes) => prevNotes.filter((note) => note.id !== id));
  };

  const handleViewNote = (id) => {
    const note = notes.find((note) => note.id === id);
    if (note) {
      alert(`Заметка: ${note.title}\nТеги: ${note.tags.join(', ')}\nДата начала: ${new Date(note.startDate).toLocaleString()}\nДата окончания: ${new Date(note.endDate).toLocaleString()}`);
    }
  };

  return (
    <Provider store={store}>
      <div className="App">
        <header className="App-header">
          <div className="logo-container">
            <img src={newLogo} className="App-logo" alt="new logo" />
          </div>
          <AppRouter />
        </header>

        {/* Форма для добавления заметки */}
        <form className="note-form" onSubmit={handleAddNote}>
          <input
            type="text"
            className="note-input"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            placeholder="Заголовок заметки"
            required
          />
          <input
            type="text"
            className="note-input"
            value={tags}
            onChange={(e) => setTags(e.target.value)}
            placeholder="Теги (через запятую)"
          />
          <input
            type="datetime-local"
            className="note-input"
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
            required
          />
          <input
            type="datetime-local"
            className="note-input"
            value={endDate}
            onChange={(e) => setEndDate(e.target.value)}
            required
          />
          <button type="submit" className="note-button">
            Добавить заметку
          </button>
        </form>

        {/* Список заметок */}
        <div className="notes-container">
          {notes.map((note) => (
            <div className="note" key={note.id}>
              <div className="note-header">
                <span className="note-id">Заметка {note.id}</span>
                <button
                  className="delete-note"
                  onClick={() => handleDeleteNote(note.id)}
                >
                  Удалить
                </button>
              </div>
              <div className="note-body">
                <div className="note-title">{note.title}</div>
                <div className="note-tags">{note.tags.join(', ')}</div>
                <div className="note-dates">
                  <p><strong>Дата начала:</strong> {new Date(note.startDate).toLocaleString()}</p>
                  <p><strong>Дата окончания:</strong> {new Date(note.endDate).toLocaleString()}</p>
                </div>
                <button
                  className="view-note"
                  onClick={() => handleViewNote(note.id)}
                >
                  Смотреть
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </Provider>
  );
};

export default App;
